import React from 'react';
import People from '../People'

export class SearchBox extends React.Component {



    render() {
        // console.log(People);
        return(

            <div>
                <input placeholder="Search" type="text" name="inputbox"/>
                <ul>
                    <li>{People[0].first_name}</li>
                    <li>{People[1].first_name}</li>
                    <li>{People[2].first_name}</li>
                </ul>
            </div>
        )
    }
}
